import React from 'react';

const Contact: React.FC = () => {
  return (
    <div id="content">
      <h2>Contact Us</h2>
      <p>For more information, collaboration, or just to say hello:</p>
      <ul>
        <li>Email: <a href="mailto:southpoolskeptics@gmail.com">southpoolskeptics@gmail.com</a></li>
      </ul>
    </div>
  );
};

export default Contact;
